import './style.css';

function Footer() {
    return (
        <footer className='footer'>
            <div className='container'>
                <div className='row' id='brand-text'>
                    <div className='col-sm-12'>
                        <p>
                           This page was made with
                           dedication and love &#128150;
                            </p>
                    </div>
                </div>
            </div>
        </footer>
    )
}

export default Footer;
